<!DOCTYPE html>
<html lang="en">
  <script>
      function ws_connect(){
        var myWebSocket = new WebSocket("ws://" + window.location.hostname + ":8000");
        myWebSocket.onmessage = function(e) {
            console.log(e.data);
            setTimeout(() => {
              var myImageElement = document.getElementById('qrcode');
              myImageElement.src = './qrcode.png?rand=' + Math.random();
            }, 500);
        };
        myWebSocket.onclose = function(e) {
            setTimeout(function() {
              ws_connect();
            }, 1000);
          };
        }
  </script>
